import React from "react";
import { Link } from "react-router-dom";

export default function Languages(props) {
   return (
      <div className="dropdown">
         <div className="dropbtn">
            {props.name}
            "M5,2 Q 8,5 5,8"
         </div>
         <Link to="/lang">
            <div className="dropdown-content" onClick={props.onClick}>
               <p>{props.link1}</p>
               <p>{props.link2}</p>
               <p>{props.link3}</p>
            </div>
         </Link>
      </div>
   );
}
